properties.code:
/**
	Returns an HTML table displaying the CSV data

	@param {Object} csvRow - A CSV row
	@param {Object} headerRows - An optional list of CSV rows containing the header rows of the table
	@return {String} return HTML table representing the CSV arguments
*/
function createTableFromCsvRow(csvRow, headerRows) {
	var html = '<table>';

	if (headerRows != null) {
		for (var i = 0; i < headerRows.length; i++) {
			var headerRow = headerRows[i];
			html += '<tr>';
			for (var j = 0; j < headerRow.children().length(); j++) {
				html += '<th>' + headerRow.children()[j] + '</th>';
			}
			html += '</tr>';
		}
	}

	if (csvRow != null) {
		html += '<tr>';
		for (var i = 0; i < csvRow.children().length(); i++) {
			html += '<td>' + csvRow.children()[i] + '</td>';
		}
		html += '</tr>';
	}

	html += '</table>';
	return html;
}

/**
	Get SANER measure group code from MeasureReport_Group.

	@param {Object} group - MeasureReport_Group JSON object
	@return {String} return SANER measure group code or null
*/
function getGroupCode(group) {
	for (var i = 0; i < group['code']['coding'].length; i++) {
		var coding = group['code']['coding'][i];

		// The examples use either of these systems for groups
		if (coding['system'] === 'http://hl7.org/fhir/us/saner/CodeSystem/MeasureGroupSystem'
			|| coding['system'] === 'http://hl7.org/fhir/us/saner/CodeSystem/PopulationSystem') {
			return coding['code'];
		}
	}
	return null;
}

/**
	Get SANER population code from MeasureReport_Population.

	@param {Object} population - MeasureReport_Population JSON object
	@return {String} return SANER population code or null
*/
function getPopulationCode(population) {
	for (var i = 0; i < population['code']['coding'].length; i++) {
		var coding = population['code']['coding'][i];

		// The examples use either of these systems for their population measures
		if (coding['system'] === 'http://hl7.org/fhir/us/saner/CodeSystem/MeasurePopulationSystem'
			|| coding['system'] === 'http://hl7.org/fhir/us/saner/CodeSystem/PopulationSystem') {
			return coding['code'];
		}
	}
	return null;
}

/**
	Returns the value or '' if null.

	@param {String} value - A string value
	@return {String} return the value or '' if null
*/
function getValueOrEmpty(value) {
	if (value == null) {
		return '';
	}
	return value;
}

/**
	Takes a FHIR MeasureReport resource and converts it into a CDC CSV.

	@param {Object} measureReport - FHIR MeasureReport in JSON
	@return {Object} return new Row
*/
function cdcMeasureReportToCSV(measureReport) {
	var columns = ["collectiondate","numTotBeds","numbeds","numBedsOcc","numICUBeds","numICUBedsOcc","numVent","numVentUse","numC19HospPats","numC19MechVentPats","numC19HOPats","numC19OverflowPats","numC19OFMechVentPats","numC19Died"];

	// generate a new empty row
	var row = <row/>;
	for (var c=0; c<columns.length; c++) {
		row[columns[c]] = "";
	}

	for (var i=0; i<measureReport['group'].length; i++) {
		var group = measureReport['group'][i];
		var groupCode = getGroupCode(group);
		if (groupCode === 'Beds') {
			mapBedsMeasures(group, row);
		} else if (groupCode === 'Ventilators') {
			mapVentilatorsMeasures(group, row);
		} else if (groupCode === 'Encounters') {
			mapEncountersMeasures(group, row);
		}
	}
	if (measureReport['period'] != null && measureReport['period']['end'] != null) {
		row['collectiondate'] = convertDate(measureReport['period']['end'], 'MM/dd/yyyy');
	}
	return row;
}

function mapBedsMeasures(group, row) {
	if (group['population'] != null) {
		for (var i = 0; i < group['population'].length; i++) {
			var population = group['population'][i];
			var measureCode = getPopulationCode(population);
			if (measureCode === 'numTotBeds') {
				row['numTotBeds'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numBeds') {
				row['numbeds'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numBedsOcc') {
				row['numBedsOcc'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numICUBeds') {
				row['numICUBeds'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numICUBedsOcc') {
				row['numICUBedsOcc'] = getValueOrEmpty(population['count']);
			}
		}
	}
}

function mapVentilatorsMeasures(group, row) {
	if (group['population'] != null) {
		for (var i = 0; i < group['population'].length; i++) {
			var population = group['population'][i];
			var measureCode = getPopulationCode(population);
			if (measureCode === 'numVent') {
				row['numVent'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numVentUse') {
				row['numVentUse'] = getValueOrEmpty(population['count']);
			}
		}
	}
}

function mapEncountersMeasures(group, row) {
	if (group['population'] != null) {
		for (var i = 0; i < group['population'].length; i++) {
			var population = group['population'][i];
			var measureCode = getPopulationCode(population);
			if (measureCode === 'numC19HospPats') {
				row['numC19HospPats'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numC19MechVentPats') {
				row['numC19MechVentPats'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numC19HOPats') {
				row['numC19HOPats'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numC19OverflowPats') {
				row['numC19OverflowPats'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numC19OFMechVentPats') {
				row['numC19OFMechVentPats'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numC19Died') {
				row['numC19Died'] = getValueOrEmpty(population['count']);
			}
		}
	}
}

/**
	Takes a FHIR MeasureReport resource and converts it into a FEMA CSV.

	@param {Object} measureReport - FHIR MeasureReport in JSON
	@param {String} location - The location/subject of the report
	@return {Object} return new Row
*/
function femaMeasureReportToCSV(measureReport, location) {
	var columns = ['dataElement','newDiagnosticTestsOrderedReceived','cumulativeDiagnosticTestsOrderedReceived','newTestsResulted','cumulativeSpecimensRejected','cumulativeTestsPerformed','newPositiveCovid19Tests','cumulativePositiveCovid19Tests','percentPositiveAmongNewlyResultedTests','cumulativePercentPositiveAmongResultedTests'];
	var row  = <row/>;
	for (var c=0; c<columns.length; c++) {
		row[columns[c]] = "";
	}

	row['dataElement'] = location;

	for (var i =0; i < measureReport['group'].length; i++) {
		var group = measureReport['group'][i];
		var groupCode = getGroupCode(group);
		if (groupCode === 'positiveIncreasePercent') {
			mapPositiveIncreasePercentMeasures(group, row);
		} else if (groupCode === 'positivePercent') {
			mapPositivePercentMeasures(group, row);
		}
	}
	return row;
}

function mapPositiveIncreasePercentMeasures(group, row) {
	var positiveIncrease = null; //numerator
	var totalTestResultsIncrease = null; //denominator
	for (var i = 0; i < group['population'].length; i++) {
		var population = group['population'][i];
		var measureCode = getPopulationCode(population);
		if (measureCode === 'totalOrdersIncrease') {
			row['newDiagnosticTestsOrderedReceived'] = getValueOrEmpty(population['count']);
		} else if (measureCode === 'totalTestResultsIncrease') {
			row['newTestsResulted'] = getValueOrEmpty(population['count']);
			totalTestResultsIncrease = parseInt(row['newTestsResulted']);
		} else if (measureCode === 'positiveIncrease') {
			row['newPositiveCovid19Tests'] = getValueOrEmpty(population['count']);
			positiveIncrease = parseInt(row['newPositiveCovid19Tests']);
		}
	}

	// TODO - check calculations
//	if ((null != positiveIncrease != totalTestResultsIncrease) && !isNaN(positiveIncrease) && !isNaN(totalTestResultsIncrease) && totalTestResultsIncrease !== 0) {
//		var percentPositiveAmongNewlyResultedTests = positiveIncrease / totalTestResultsIncrease;
//		
//		row['percentPositiveAmongNewlyResultedTests'] = (100 * percentPositiveAmongNewlyResultedTests).toFixed(2) + '%';
//	}

	// It's not clear how to determine this value, so we're leaving it blank.
	row['percentPositiveAmongNewlyResultedTests'] = '';
}

function mapPositivePercentMeasures(group, row) {
	var positive = null; //numerator
	var totalTestResults = null; //denominator
	var rejected = null; // denominator-exclusion
	for (var i = 0; i < group['population'].length; i++) {
		var population = group['population'][i];
		var measureCode = getPopulationCode(population);
		if (measureCode === 'totalOrders') {
			row['cumulativeDiagnosticTestsOrderedReceived'] = getValueOrEmpty(population['count']);
		} else if (measureCode === 'rejected') {
			row['cumulativeSpecimensRejected'] = getValueOrEmpty(population['count']);
			rejected = parseInt(row['cumulativeSpecimensRejected']);
		} else if (measureCode === 'totalTestResults') {
			row['cumulativeTestsPerformed'] = getValueOrEmpty(population['count']);
			totalTestResults = parseInt(row['cumulativeTestsPerformed']);
		}  else if (measureCode === 'positive') {
			row['cumulativePositiveCovid19Tests'] = getValueOrEmpty(population['count']);
			positive = parseInt(row['cumulativePositiveCovid19Tests']);
		}
	}

//	// TODO - check calculations
//	if ((null != positive != totalTestResults) && !isNaN(positive) && !isNaN(totalTestResults) && totalTestResults !== 0) {
//		var cumulativePercentPositiveAmongResultedTests = 0;
//		if (rejected == null || isNaN(rejected)) {
//			cumulativePercentPositiveAmongResultedTests = positive / totalTestResults;
//		} else {
//			cumulativePercentPositiveAmongResultedTests = positive / (totalTestResults - rejected);
//			
//		}
//		row['cumulativePercentPositiveAmongResultedTests'] = (100 * cumulativePercentPositiveAmongResultedTests).toFixed(2) + '%';
//	}

	// It's not clear how to determine this value, so we're leaving it blank.
	row['cumulativePercentPositiveAmongResultedTests'] = '';
}

/**
	Deletes null value "count" nodes in MeasureReport.group[i].population[j] nodes and adds a "_count" node to them that indicates the data is absent.
	Modifies the JSON object passed in.

	@param {Object} measureReport - The MeasureReport JSON object
*/
function replaceNullCounts(measureReport) {
	if (measureReport['group'] != null) {
	for (var i=0; i<measureReport['group'].length; i++) {
		var group = measureReport['group'][i];
		if (group['population'] != null) {
			for (var p=0; p<group['population'].length; p++) {
				var population = group['population'][p];
				var count = population['count'];
				if (count == null || isNaN(count)) {
					// remove child count
					delete population['count'];

					population['_count'] = {
  										"extension": [
										    {
										      "url": "http://hl7.org/fhir/StructureDefinition/data-absent-reason",
										      "valueCode": "unsupported"
										    }
										  ]
										};

				}
			}
		}
	}
}
